INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('2', 'Approval in Principal (Green)', 'Thank you for applying with Fullerton India. Your Personal Loan application is approved in principle* for Rs @@amt@@. Your reference number is @@refno@@. *TCA. Track your Application Status: @@status@@', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('3', 'Approval in Principal (Amber)', 'Thank you for applying with Fullerton India. Your Personal Loan application has been submitted for further processing*. Your reference number is @@refno@@.TCA.  Track your Application Status: https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('4', 'Approval in Principal (Red)', 'Thank you for applying with Fullerton India. We regret to inform, your application did not meet internal criteria. *TCA. Track your Application Status: https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('5', 'Final Reject SMS ', 'Thank you for applying with Fullerton India. We regret not being able to offer you a loan basis the information and documents provided by you currently. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('6', 'Customer drops off on  portal before page 3 submit and after OTP confirmation', 'Dear @@consumer name@@, your application for Fullerton India PL is incomplete. We will call you to assist in completing your loan application. Fullerton India. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('7', 'AIP not done intimation', '@@Name@@ Thank you for applying. We regret, your application could not be completed due to technical reasons. Our representative will call you shortly. *TCA. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('8', 'resume your application - session downtime', 'Dear @@consumer name@@, We have not received your complete application. Just a step remaining for your application, we have sent your application link to @@customer email@@ , which will take you right from the point it was left! Fullerton India Personal loan. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('9', 'resume your application - session downtime', 'Dear @@consumer name@@, resume your application, right from the point it was left ! we have sent your application link to @@consumer email@@. Fullerton India Personal loan. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
INSERT INTO `fullerton`.`sms_template` (`id`, `name`, `body`, `active`) VALUES ('10', 'Customer drop off on  portal - not contactable', 'Dear @@consumer name@@, we tried reaching you to help complete your online application for Fullerton India personal loan. We will call you again soon. Fullerton India. Track your Application Status : https://goo.gl/TajbzQ.', b'1');
